import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { NavMenuComponent } from './nav-menu/nav-menu.component';
import { HomeComponent } from './home/home.component';
import { CounterComponent } from './counter/counter.component';
import { FetchDataComponent } from './fetch-data/fetch-data.component';
import {MarkerCreateComponent} from "./components/marker-create/marker-create.component";
import {UserRegisterComponent} from "./components/user-register/user-register.component";
import {AnimalEditComponent} from "./components/animal-edit/animal-edit.component";
import {AnimalDetailComponent} from "./components/animal-detail/animal-detail.component";
import {AnimalCreateComponent} from "./components/animal-create/animal-create.component";
import {AnimalListComponent} from "./components/animal-list/animal-list.component";

@NgModule({
  declarations: [
    AppComponent,
    NavMenuComponent,
    HomeComponent,
    CounterComponent,
    FetchDataComponent
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot([
      { path: '', component: HomeComponent, pathMatch: 'full' },
      { path: 'counter', component: CounterComponent },
      { path: 'fetch-data', component: FetchDataComponent },
      { path: 'animals', component: AnimalListComponent },
      { path: 'animals/create', component: AnimalCreateComponent },
      { path: 'animals/:id', component: AnimalDetailComponent },
      { path: 'animals/edit/:id', component: AnimalEditComponent },
      { path: 'users/register', component: UserRegisterComponent },
      { path: 'markers/create', component: MarkerCreateComponent },
    ])
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
